import React from "react";
import styled from "styled-components";

const MapContainer = styled.div`
  width: auto;
  height: auto;
  position: relative;
`;

const Circle = styled.div`
  width: 40px;
  height: 40px;
  border-radius: 50%;
  background-color: red;
  position: relative;
  top: ${(props) => props.fromTop};
  left: ${(props) => props.fromLeft};
`;

const SmallCircle = styled.Circle`
  width: 20px;
  height: 20px;
`;

const Line8 = () => {
  return (
    <MapContainer>
      <img src={`${process.env.PUBLIC_URL}/images/line8.jpg`} alt="line8" />
      <Circle fromTop="-715px" fromLeft="351px" />
      <Circle fromTop="-755px" fromLeft="832px" />
      <Circle fromTop="-795px" fromLeft="992px" />
      <Circle fromTop="-511px" fromLeft="489px" />
      <Circle fromTop="-551px" fromLeft="812px" />
    </MapContainer>
  );
};

export default Line8;
